function Header(){
    return(
        <header>
            <ul>
                <img src="/imgs/temple.png" alt="Logo" />
                <li><a href="#">Home</a></li>
                <li><a href="#">Ueber uns</a></li>
                <li><a href="#">Wettbewerbe</a></li>
                <li><a href="#">Trainingszeiten</a></li>
            </ul>
        </header>
    );
}

export default Header;
